import React from "react";
import { Language } from "../../../apis/model";
import "./languages.css";

interface Props {
  languages: Language[];
}

const Languages: React.FC<Props> = ({ languages }) => {
  return (
    <div className="languages" style={{}}>
      <h2>Languages</h2>
      <ul className="list">
        {languages
          .sort((a, b) => b.level - a.level)
          .map((language, index) => {
            return <LanguageItem {...{ language }} key={index} />;
          })}
      </ul>
    </div>
  );
};
export default Languages;

const LanguageItem = ({ language }: { language: Language }) => {
  return (
    <li className="list-item language-item">
      <p className="">{language.lang}</p>
    </li>
  );
};
